import './App.css';
import ItemForm from './components/ItemForm';
import Items from './components/Items';

function App() {
  const [todos, setTodos] = useState(['Todo1','Todo2'])

  return (
    <div>
      <h1>Todos</h1>
      <ItemForm />
      <Items todos={todos} />
    </div>
  )
}

export default App;
